import './App.css';
import Logo from './componenets/Logo/Logo';
import Navigation from './componenets/navigation/Navigation';
import ImageLinkForm from './componenets/ImageLinkForm/ImageLinkForm';
import Rank from './componenets/Rank/Rank';
import Particles from 'react-particles-js';

// const particalOptions = {
//     polygon: {
//         enable: true,
//         type: 'inside',
//         move: {
//             radius: 10
//         },
//         url: 'path/to/svg.svg'
//     }
// }
function App() {
  return (
    <div className="App">
                  <Particles 
                params={{
                  polygon: {
                      enable: true,
                      type: 'inside',
                      move: {
                          radius: 10
                      },
                  }
              }} />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm />
      {/*<FaceRecognition /> */}
    </div>
  );
}

export default App;
